Teaser:
Führen Sie Ihre C/C++-Programme in ChATGPT über diese Eingabeaufforderung aus. Dies ist eine sehr leistungsstarke Eingabeaufforderung, mit der Sie mithilfe von Chatgpt alle Arten von Programmiersprachen direkt in Ihrem Webbrowser ausführen können.

 Geben Sie einfach Ihren C- oder C++-Code ein, den Sie in der Eingabeaufforderung ausführen möchten, und Chat-GPT gibt Ihnen als Antwort die Ausgabe dieses Programms.

 Dies ist nützlich, wenn Sie keinen Compiler auf Ihrem PC installiert haben und Code jetzt testen möchten. Dies können Sie durch eine einfache Eingabeaufforderung tun.

 Beispiel für C++-Code.
 #include <Istream>

 int main() {
  std::cout << "Hallo chat-gpt3" << std::endl;
  0 zurückgeben;
 }
